import React from 'react'
import Carousel from 'react-elastic-carousel'

const Carrousel = ({}) => {
  return (
    <div>
        <Carousel>
          <img src={naranjo} alt='naranjo'></img>
        </Carousel>
    </div>
  )
}

export default Carrousel
